import React from "react";
import AllCategories from "./AllCategories";

const Category = () => {
  const onSaveAllCategoris = (catgories) => {};
  return (
    <nav>
      <ul>
        <li>
          <AllCategories onSaveAllCategoris={onSaveAllCategoris} />
        </li>
        <li>Mobiles</li>
      </ul>
    </nav>
  );
};

export default Category;
